        </>
        <>
          <BannerImg src={Netflix1} alt="Netflix1" />
        </>
      </SlideBox>
    </div>
  );
}

const SlideBox = styled.div`
    width: 1400px;
    height:400px;
    margin: 0px auto;
    /* overflow:auto;
    white-space: nowrap; */
    /* overflow-x: scroll;
    scroll-snap-type: x mandatory; */

`;
const BannerImg = styled.img`
  height: 300px;
  width: 200px;
  border-radius: 20px;
  padding: 10px;
  cursor:pointer;
`;
